import { Link } from 'react-router-dom';

<div class="navbar">
  <a href="#home" class="active">Home</a>
  <a href="#news">News</a>
  <a href="#contact">Contact</a>
</div>

const Nav = () => {
  return (
    <div class="navbar">
        <Link to="/" class="active">
        Home
        </Link>
        <Link to="/search">
        Search
        </Link>
        <Link to="/favourite-list">
        Favourite
        </Link>
      </div>
  );
};

export default Nav;
